import React, { Component } from "react";
import { connect } from "react-redux";
import { getBill } from "../store/actions";
import waterBillLogo from "../img/Ab-o-Fazelab-01.svg";

class WaterTemplate extends Component {
  state = {};
  render() {
    console.log(this.props.billData);
    return (
      <div className=" col-lg-10">
        <div className="water-template">
          <div>
            <img src={waterBillLogo} width="50px" alt="" />
            شرکت آب و فاضلاب
          </div>
        </div>
      </div>
    );
  }
}

const mapStateToProps = ({ GetBillReducer }) => {
  return {
    billData: GetBillReducer.data,
  };
};
export default connect(mapStateToProps, {
  getBill,
})(WaterTemplate);
